import React, { useState, useEffect } from "react"
import GraphQLFetch from "../Helpers/GraphQLFetch"

function Student(props) {
  const [myInfo, setMyInfo] = useState({
    name: "",
    reg_no: "",
    school: { name: "", code: "" },
  })

  useEffect(() => {
    fetchMyInfo()
  }, [])

  async function fetchMyInfo() {
    setTimeout(async () => {
      let res = await GraphQLFetch(`{
          myInfo(reg_no: "${props.reg_no}"){
            name
            reg_no
            school{
              name
              code
            }
          }
        }`)
      console.log(res.data.myInfo)
      // setMyInfo(res.data.myInfo)
      console.log(myInfo)
    }, 500)
  }
  return (
    <div className="student">
      <div className="title">Student's Page </div>
      <div className="my-school">{myInfo.school.name}</div>
      <div className="my-candidates"></div>
    </div>
  )
}

export default Student
